import React from 'react'
import styled from 'styled-components'

function Footer() {
  return (
    <Container>
      <a href="/" className='footer-links'>Contact</a>
      <p>v2.0</p>
      <a href="/" className='footer-liinks'>Instagram</a>
    </Container>
  )
}

export default Footer

const Container = styled.div`
  width: 100%;
  display: flex;
  justify-content: spa;
`
